import React from 'react';
import { Link } from 'react-router-dom';
import studt from "../assets/student.jpeg";
import faclt from "../assets/faculty.png";
import secut from "../assets/security.png";

// import LoginRegisterOptions from './Components/LoginRegisterOptions';

const Home = () => {
  return (
    <div>
      <h2>Welcome to gatepass</h2>
      {/* <img src="cbit_logo.png" alt="Your App" /> */}
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
        <img
          src="cbit_logo.png"
          alt="Your App"
          style={{ width: '100%', maxWidth: '80%', height: 'auto' }}
        />
      </div>
      <div className="container">
        <div className="button_text">
          <Link to="/Studentlogin">
            <img className="imge" src={studt} alt="Student Login" />
          </Link>
          <div className="button_label">Student</div>
        </div>
        <div className="button_text">
          <Link to="/FacultyLogin">
            <img className="imge" src={faclt} alt="Faculty Login" />
          </Link>
          <div className="button_label">Faculty</div>
        </div>
        <div className="button_text">
          <Link to="/SecurityLogin">
            <img className="imge" src={secut} alt="Security Login" />
          </Link>
          <div className="button_label">Security</div>
        </div>
      </div>
    </div>

  );
};
export default Home;
